import React from "react";
import { contacts } from "../contacts";

function Card(props) {
  return (
    <div>
      <img src={contacts[0].image} alt="" />
    </div>
  );
}
function App(contacts) {
  return (
    <div>
      <h1 className="heading">My contacts</h1>
      <Card />
    </div>
  );
}

export default App;

